import {createBrowserRouter,createRoutesFromElements,Route,RouterProvider} from "react-router-dom"
import AbouPage from "./pages/AbouPage";
import ErrorPage from "./pages/ErrorPage";
import Home from "./pages/Home";
import LayoutPage from "./pages/LayoutPage";

function App() {

  const Routers=createRoutesFromElements(
       <Route>
        <Route path="/" element={<LayoutPage/>,errorW}>

         <Route path="/" element={<Home/>}/>
         <Route path="about" element={<AbouPage/>}/>
         <Route path="*" element={<ErrorPage/>}/>
        </Route>
       </Route>
  )

  // const routes=createBrowserRouter([
        //{path:"/",element:<LayoutPage/>,children:[
          //    {path:"/",element:<Home/>},
          //    {path:"about",element:<AbouPage/>}

        // ]
  // ])

  const routes=createBrowserRouter(Routers)
  return (
             <RouterProvider router={routes}/>
  )
}

export default App;
